import React, { useState } from 'react';
import { Link, NavLink } from 'react-router-dom';

const menu = [
	{
		id: 1,
		name: 'home'
	},
	{
		id: 2,
		name: 'about',
		children: [
			{
		 		id: 8,
				name: 'about'
			},
			{
		 		id: 9,
				name: 'team'
			},
			{
		 		id: 10,
				name: 'other',
				children: [
					{
						id: 11,
 						name: 'link 1'
					},
					{
						id: 12,
 						name: 'link 2'
					},
					{
						id: 13,
 						name: 'link 3'
					}
				]
			}
		]
	},
	{
		id: 3,
		name: 'blog'
	},
	{
		id: 4,
		name: 'contact'
	},
	{
		id: 5,
		name: 'services'
	},
	{
		id: 6,
		name: 'pricing'
	},
	{
		id: 7,
		name: 'portfolio'
	}
];

function Navbar() {
	const [toggle, setToggle] = useState(false);
  const handleToggle = () => setToggle(!toggle);

  const [dropdown, setDropdown] = useState(false);
  const handleDropdown = () => setDropdown(!dropdown);

	return (
		<nav id="navbar" className={!toggle ? "navbar" : "navbar navbar-mobile"}>
			<ul>
				{
					menu.map(m => (
						<li key={m.id} className={m.children ? 'dropdown' : null}>
							{ !m.children ? (
								<NavLink to={m.name}>
									{`${m.name[0].toUpperCase()+m.name.slice(1)}`}
								</NavLink> ) : (
								<>
									<NavLink to={m.name} onClick={handleDropdown}>
										<span>{`${m.name[0].toUpperCase()+m.name.slice(1)}`}</span>
										{ dropdown ?
											(<i className="bi bi-chevron-down"></i>)
											:
											(<i className="bi bi-chevron-right"></i>)
										}
									</NavLink>
									<ul className={dropdown ? "dropdown-active" : null}>
									{
										m.children.map(mc => { !mc.children ? (
												<li key={mc.id}>
													<Link>{`${mc.name[0].toUpperCase()+mc.name.slice(1)}`}</Link>
												</li>
										) : (
													<li>
														<Link>
															<span>{`${mc.name[0].toUpperCase()+mc.name.slice(1)}`}</span>
															{ dropdown ?
																(<i className="bi bi-chevron-down"></i>)
																:
																(<i className="bi bi-chevron-right"></i>)
															}
														</Link>
													</li>
												)
											}
										)
									}
									</ul>
								</>
								)}
						</li>
	 	 		  ))
				}
			</ul>
			{ !toggle ?
 				(<i onClick={handleToggle} className="bi mobile-nav-toggle bi-list"></i>)
				:
				(<i onClick={handleToggle} className="bi mobile-nav-toggle bi-x"></i>)
			}
		</nav>
	)
}

function Header() {
	return (
  	<header id="header" className="fixed-top d-flex align-items-center">
			<div className="container d-flex align-items-center justify-content-between">
				<div className="logo">
					<h1 className="text-light"><NavLink to="/" className={({ isActive, isPending }) =>
    isPending ? "pending" : isActive ? "active" : ""
  }>Serenity</NavLink></h1>
					{/*<Link to="/">
						<img src="../assets/img/logo.png" alt="" className="img-fluid" />
					</Link>*/}
				</div>
				<Navbar />
			</div>
		</header>
	)
}

export default Header;
